class TripInfoControl extends React.Component {

  render(){
    return(
      <React.Fragment>
        <div class = "columns">
          <div class ="column">
            <InputForm/>
          </div>
          <div class ="column">
            <TripInfo/>
          </div>
        </div>
      </React.Fragment>
    )
  }

};

export default TripInfoControl;
